const HomePage = () => {
    const navigateTables = useNavigate()
    const navigateExercitiu3a = useNavigate()
    return (
        <div className="backgroundImage containerHomePage">
            <TaskCard onClickTables={() => {
                navigateTables("/tables")
            }}
            onClickExercitiul3a={() => {
            navigateExercitiu3a("/exercitiu3a")}
            }/>
        </div>
    );
}


export default HomePage;
